With the first building blocks in place we might be able to sketch our first version of a Brain . The first part we need to define the struct that will contain the list of Thoughts that are about to be processed. We wrap them into an Option to indeciate those that do not need further processing. struct Brain { /// the list of `Thoughts`s that require processing thoughts: Vec<Option<Thought>>,
} Now we can implement a function that is able to take a Future, wrap into a Thought and push it to the list. impl Brain { /// Add a new `Future` to the [Brain], so it can be processed fn think_on(&mut self, thinkable: impl Future<Output = ()> + 'static) { // ensure the given Future is getting a fixed position on the HEAP let thinkable = Box::pin(thinkable); // create the Thought let thought = Thought { thinkable, }; // push the Thought to the list of thoughts to think on self.thoughts.push(Some(thought)); }
} Finally the Brain requires a function that allows processing of the list of Thought's. This function will iterate over the items of Brain::thoughts and will call the poll function for each Future contain in the Thought. If this polling yields a Poll::Pending state the Thought will be kept in place of the list and is polled again at the next cycle . impl Brain { /// Do the actual thinking - check for Thoughts that waits for processing /// and drive them to completion fn do_thinking(&mut self) { // run through the list of Thoughts that require thinking for maybe_thought in self.thoughts.iter_mut() { if let Some(thought) = maybe_thought.take() { // polling the Future requires some kind of Context, we will // discuss this in the next chapter if let Poll::Pending = thought.thinkable.as_mut().poll(cx) { // as long as the state is Poll::Pending we put the // the Thought back in place for the next round *maybe_thought = Some(thought); } } } }
} The actual first sketch of the Brain has several flaws. One of them is the poll function of the Future requiring a Context to be passed. Without having this in place the code will actually not compile. However, before dealing with the different challenges of the above coude let's have a look how we could make use of the Brain. As a first step we will define a Future that returns a constant value after it has been polled for a fixed number of tries. Nothing really asynchronous here, you are totally right, but let's start simple. struct GiveNumberFuture { give_after_tries: u32, current_tries: u32,
} impl Future for GiveNumberFuture { type Output = u32; fn poll(self: Pin<&mut Self>, cx: &mut Context<'_>) -> Poll<Self::Output> { let this = self.get_mut(); println!("polled {} time(s)", this.current_tries + 1); if this.give_after_tries > this.current_tries + 1 { this.current_tries += 1; Poll::Pending } else { Poll::Ready(20) } }
} This Future does return a value and will reflect the first state in the already discussed outermost future like so: enum MasterFuture { State1(Pin<Box<dyn Future<Output = u32>>>),
} impl Future for MasterFuture { type Output = (); fn poll(self: Pin<&mut Self>, cx: &mut Context<'_>) -> Poll<Self::Output> { let this = self.get_mut(); match this { Self::State1(wait_for) => { if let Poll::Ready(number) = wait_for.as_mut().poll(cx) { println!("waited for {}", number); Poll::Ready(()) } else { Poll::Pending } } } }
} Within the main function we can now create our Brain, tell it to think on the master thought which will ultimately wait for the first state to be ready. fn main() { println!("Hello, world!"); let mut brain = Brain { thoughts: Vec::new(), }; let future = GiveNumberFuture { give_after_tries: 10, current_tries: 0, }; brain.think_on(MasterFuture::State1( Box::pin(future) )); loop { brain.do_thinking(); }
} In case this would already compile and run it would create the following output. Hello, world!
polled 1 time(s)
polled 2 time(s)
polled 3 time(s)
polled 4 time(s)
polled 5 time(s)
polled 6 time(s)
polled 7 time(s)
polled 8 time(s)
polled 9 time(s)
polled 10 time(s)
waited for 20

