While the Rust core library provides the format and structure how a Waker should look like, the instantiation of one and the provisioning of the proper raw pointers to be used is a Executor specific implementation. How can we apply this to our Brain? Let's start buttom up. The lowest thing we need are those functions that can accept a raw pointer that represents the Wakeable thing. As all of those functions are dealing with raw pointers they are unsafe by nature, however, if we adhere to some boundary conditions they are actually safe to use. One of those conditions is, that the raw pointer to the Wakeable is always representing an Arc. Another boundary condition would be, that the type contained in the Arc is actually something we could wake. To adhere to this condition we define a Trait repesenting a Wakeable with the required functions that will be called to actualy wake it. pub trait Wakeable { fn wake(self: Arc<Self>) { Self::wake_by_ref(&self) } fn wake_by_ref(self: &Arc<Self>); With the Wakeable trait in place we can now define the different functions. It's fine to use raw pointers to those functions as they are built into the binary at a fixed position and therefore are immovable with a static lifetime. /// The first function that shall be able to *wake* the ``Wakeable``. The
/// ``Wakeable`` is consumed by this call.
pub unsafe fn wake_wakeable_raw<T: Wakeable>(wakeable: *const ()) { // transfer the raw pointer back into it's type pointer let wakeable: Arc<T> = Arc::from_raw(wakeable as *const T); // wake the wakeable Wakeable::wake(wakeable);
} /// The second function that shall be able to *wake* the ``Wakeable``. The
/// ``Wakeable`` should be woken by reference and not beeing consumed
pub unsafe fn wake_by_ref_wakeable_raw<T: Wakeable>(wakeable: *const ()) { // transfer the raw pointer back into it's type pointer let wakeable: Arc<T> = Arc::from_raw(wakeable as *const T); // wake the wakeable Wakeable::wake_by_ref(&wakeable); // don't drop the wakeable as we do not consume it core::mem::forget(wakeable);
} /// The third function is able to clone the current ``Waker`` part of the
/// current ``Wakeable``
pub unsafe fn clone_wakeable_raw<T: Wakeable>(wakeable: *const ()) -> RawWaker { let arc: Arc<T> = Arc::from_raw(wakeable as *const T); let cloned = arc.clone(); // forget both references to keep ref-count up core::mem::forget(arc); core::mem::forget(cloned); RawWaker::new( wakeable, &RawWakerVTable::new( clone_wakeable_raw::<T>, wake_wakeable_raw::<T>, wake_by_ref_wakeable_raw::<T>, // each new clone of the Waker requires to be propperly dropped drop_wakeable_raw::<T>, ) )
} /// finally the function to drop the ``Wakeable`` after it is no longer needed
pub unsafe fn drop_wakeable_raw<T: Wakeable>(wakeable: *const ()) { drop(Arc::<T>::from_raw(wakeable as *const T));
} /// Special case where a function pointer of the Waker should do nothing
pub unsafe fn noop<T: Wakeable>(_: *const ()) {} The final bit that is missing is that we would require to be able to convert a Wakebale into an actual Waker. For doing so, we provide a corresponding function with a default implementation at the Wakeable trait. fn into_waker(self: &Arc<Self>) -> Waker where Self: Sized, { let wakeable_ptr = Arc::as_ptr(self) as *const (); unsafe { Waker::from_raw(RawWaker::new( wakeable_ptr, &RawWakerVTable::new( clone_wakeable_raw::<Self>, wake_wakeable_raw::<Self>, wake_by_ref_wakeable_raw::<Self>, // when the Waker is created from the Wakeable reference // this one is not allowed to be dropped. But any Clone of // it will and has to! noop::<Self>, ) )) } }
} Note The initial created Waker is not allowed to provide a drop function as it stores the raw pointer of the initial Arc<Thought>. This could be solved if we would already clone this first Arc and pass this clone to the Waker, but this would lead to an unnecceary additional heap allocation assuming that it is rather unlikely that the Waker will be cloned at all. So this is a kind of an optimization for setting up the first Waker of a Wakeable.

